import React from "react";
import { RouteComponentProps } from "react-router";
import "../Style.css";
import DeleteForeverIcon from "@mui/icons-material/DeleteForever";
import { Button } from "@mui/material";

interface Props extends RouteComponentProps {}

const Home: React.FC<Props> = ({ history }) => {
  const clickHandler = () => {
    history.push("/user");
  };

  const handleClickResetData = () => {
    localStorage.clear();
  };

  return (
    <div className="container home__container">
      <div className="Logo home__logo">
        <h1>Alkoholový analyzátor</h1>
      </div>
      <h2>Zistite hladinu alkoholu v krvi</h2>
      <button onClick={clickHandler} className="home__button">
        Start
      </button>
      <Button
        onClick={handleClickResetData}
        sx={{ borderRadius: 10 }}
        variant="contained"
        startIcon={<DeleteForeverIcon fontSize="medium" />}
        style={{
          backgroundColor: "#C2A83E",
          borderColor: "#C2A83E",
          borderWidth: "2px",
          fontWeight: "bold",
          textTransform: "none",
        }}
      >
        Vymazať dáta
      </Button>
    </div>
  );
};

export default Home;
